import {jwt} from "jsonwebtoken";
import mongoose from "mongoose";
import bcrypt from 'bcryptjs';

const UserSchema = new mongoose.Schema({
    fullname: {type: String, required: true},
    email: {type: String, required: true},
    password: {type: String, required: true},
    address: [{detail: {type: String}, for: {type: String}}],
    phonenumber:{type: Number}
},{
    timestamps:true
});

//statics and methods :-->methods will be instanciated and statics will not be instanc

//objectid will be in object format
UserSchema.methods.generateJwtToken = function(){
    return jwt.sign({user:this._id.toString()},"ZomatoApp");
}; 
//2nd methods
UserSchema.statics.findEmailAndPhone=async({email,phonenumber})=>{
    const checkuserbyemail = await UserModel.findOne({ "email": email });
    const checkuserbyphone = await UserModel.findOne({ "phone": phonenumber });
    if (checkuserbyemail || checkuserbyphone) {
        throw new Error("userAlready Exixsts");
    }

    return false;
}

UserSchema.statics.findEmailAndPassword=async({email,password})=>{
    const user=await UserModel.findOne({email});
    if(!user){
        throw new Error("User is Not Exists");
    }
    const checkPassword=await bcrypt.compare(password,user.password);

    if(!checkPassword) throw new Error("Invalid password");

    return user;
};

UserSchema.pre("save",function(next){
    const user=this;

    //password is modified
    if(!user.isModified("password")) return next();

    bcrypt.genSalt(8,(error,salt)=>{
        if(error)return next(error);

        bcrypt.hash(user.password,salt,(error,hash)=>{
            if(error)return next(error);

            user.password=hash;
            return next();
        })
    });
});


export const UserModel = mongoose.model("Userdetails", UserSchema);

